ont-weight:700\">Estilismo Personal</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"is-service-description\"} -->\n<p class=\"is-service-description\">Trabaja uno a uno con nuestros estilistas expertos para crear conjuntos que se alineen con tu gusto único, tipo de cuerpo y estilo de vida.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"className\":\"is-service-name\",\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading is-service-name has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Alteraciones y confección</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"is-service-description\"} -->\n<p class=\"is-service-description\">Asegura el ajuste perfecto. Desde dobladillos hasta ajustes de talla, nuestros hábiles sastres adaptarán tus prendas<br>a la perfección.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"var:preset|spacing|20\"} -->\n<div style=\"height:var(--wp--preset--spacing--20)\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|40\",\"left\":\"var:preset|spacing|40\"}}}} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"className\":\"is-service-name\",\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading is-service-name has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Renovación del armario</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"is-service-description\"} -->\n<p class=\"is-service-description\">Renueva tu armario. Nuestros estilistas te ayudarán a deshacerte de lo que no necesitas, organizar y actualizar tu vestidor con nuevas piezas frescas.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"className\":\"is-service-name\",\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading is-service-name has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Compra Virtual</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"className\":\"is-service-description\"} -->\n<p class=\"is-service-description\">¿No puedes venir a nuestra tienda? Nuestro servicio de asistencia de compras virtual te permite comprar desde la comodidad de tu casa.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer --></div>\n<!-- /wp:group -->\";s:14:\"disallow_after\";a:0:{}s:12:\"dependencies\";a:0:{}s:10:\"categories\";a:1:{s:25:\"_dotcom_imported_services\";a:3:{s:4:\"slug\";s:25:\"_dotcom_imported_services\";s:5:\"title\";s:25:\"_dotcom_imported_services\";s:11:\"description\";s:0:\"\";}}s:24:\"virtual_theme_categories\";a:0:{}s:4:\"tags\";a:0:{}s:12:\"pattern_meta\";a:0:{}s:10:\"source_url\";s:75:\"https://wooblockpatterns.wpcomstaging.com/2024/07/02/grid-of-text-features/\";s:13:\"modified_date\";s:19:\"2024-07-04 13:41:09\";s:12:\"preview_data\";a:0:{}s:9:\"post_type\";s:8:\"wp_block\";s:22:\"is_included_in_big_sky\";i:0;}i:11;a:18:{s:2:\"ID\";i:378;s:7:\"site_id\";i:231214916;s:5:\"title\";s:50:\"Encabezados a la izquierda, con