l;font-weight:700\">Pruebas de hogar</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>¿Planeando vender tu casa? Nuestro servicio de pruebas de casas te ayudará a maximizar su atractivo para los compradores potenciales, mostrando su máximo potencial.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer {\"height\":\"56px\"} -->\n<div style=\"height:56px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"layout\":{\"type\":\"flex\",\"orientation\":\"vertical\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Consulta de diseño de interiores</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Nuestros diseñadores expertos trabajarán contigo para transformar tu espacio en un refugio elegante y funcional que refleje tu estilo personal y tu forma de vida.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"style\":{\"spacing\":{\"blockGap\":\"0\"}}} -->\n<div class=\"wp-block-column\"><!-- wp:group {\"layout\":{\"type\":\"flex\",\"orientation\":\"vertical\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Restauración de muebles</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Restaura la belleza de tus queridos muebles. Desde el acabado hasta las reparaciones, daremos nueva vida a tus elementos atesorados.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group -->\n\n<!-- wp:spacer {\"height\":\"56px\"} -->\n<div style=\"height:56px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<