spacer -->\n\n<!-- wp:columns {\"metadata\":{\"name\":\"Team members\"},\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|50\",\"left\":\"var:preset|spacing|30\"}}}} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":336,\"aspectRatio\":\"1\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/fab46ce87d847342cbe7410cdaa90732.jpeg\" alt=\"\" class=\"wp-image-336\" style=\"aspect-ratio:1;object-fit:cover\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:spacer {\"height\":\"4px\"} -->\n<div style=\"height:4px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"9px\"}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Emily Hayes</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Interiorista</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>Emily aporta más de una década de experiencia en diseño de interiores, especializándose en crear espacios únicos y personalizados que reflejan la personalidad y el estilo de vida de cada cliente.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":335,\"aspectRatio\":\"1\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/f53d7341f90e86c42ed293bb386b5db4.jpeg\" alt=\"\" class=\"wp-image-335\" style=\"aspect-ratio:1;object-fit:cover\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:spacer {\"height\":\"4px\"} -->\n<div style=\"height:4px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"9px\"}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Mark Johnson</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Diseñador de muebles</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>Con un ojo agudo para el detalle y la artesanía, Mark diseña piezas de mobiliario que combinan estilo con funcionalidad, asegurando que cada pieza realce la belleza de cualquier espacio.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":331,\"aspectRatio\":\"1\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/885b26a44a4ca21844c169eca79dcf8c.jpeg\" alt=\"\" class=\"wp-image-331\" style=\"aspect-ratio:1;object-fit:cover\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:spacer {\"height\":\"4px\"} -->\n<div style=\"height:4px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"9px\"}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Alex Parker</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Especialista en atención al cliente</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>Alex está comprometido a asegurar que nuestros clientes tengan una experiencia sin interrupciones, ofreciendo un soporte y asistencia atentos con cualquier consulta o preocupación que puedan tener.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u002dhorizontal)))\"} -->\n<div style=\"height:calc( 0.25 * var(--wp--style--root--padding-right, var(--wp--custom--gap--horizontal)))\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"metadata\":{\"name\":\"Team members\"},\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|50\",\"left\":\"var:preset|spacing|30\"}}}} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":330,\"aspectRatio\":\"1\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/44df767ec48f3788eb836df942c12ca5.jpeg\" alt=\"\" class=\"wp-image-330\" style=\"aspect-ratio:1;object-fit:cover\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:spacer {\"height\":\"4px\"} -->\n<div style=\"height:4px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"9px\"}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">David Carter</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Gestor de proyectos</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>David supervisa cada proyecto con precisión y eficiencia, asegurándose de que se cumplan los plazos y de que cada detalle se ejecute a la perfección desde el concepto hasta la finalización.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":332,\"aspectRatio\":\"1\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/b804be09af895837548af933fdea519f.jpeg\" alt=\"\" class=\"wp-image-332\" style=\"aspect-ratio:1;object-fit:cover\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:spacer {\"height\":\"4px\"} -->\n<div style=\"height:4px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"9px\"}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Sophia Lee</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>gestor de ventas</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>Sophia se dedica a ofrecer un servicio excepcional a nuestros clientes, brindando orientación para ayudarles a encontrar los muebles y piezas de decoración perfectas para sus hogares.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":339,\"aspectRatio\":\"1\",\"scale\":\"cover\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\",\"style\":{\"color\":[]}} -->\n<figure class=\"wp-block-image size-full\"><img src=\"https://wooblockpatterns.wpcomstaging.com/wp-content/uploads/2024/07/05414bb38f179cc7c6969cbaf1b152e1-1.jpeg\" alt=\"\" class=\"wp-image-339\" style=\"aspect-ratio:1;object-fit:cover\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:spacer {\"height\":\"4px\"} -->\n<div style=\"height:4px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:group {\"style\":{\"spacing\":{\"blockGap\":\"9px\"}},\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:heading {\"level\":3,\"style\":{\"typography\":{\"fontStyle\":\"normal\",\"fontWeight\":\"700\"}},\"fontSize\":\"medium\"} -->\n<h3 class=\"wp-block-heading has-medium-font-size\" style=\"font-style:normal;font-weight:700\">Emma Reynolds</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Coordinador de marketing</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p>La creatividad y la pasión por el diseño de Emma brillan en su trabajo, mientras curates contenido cautivador y campañas atractivas para Exposición nuestros productos y servicios.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:spacer {\"height\":\"calc( 0.25 * var(\\u002d\\u002dwp\\u002d\\u002dstyle\\u002d\\u002droot\\u002d\\u002dpadding-right, var(\\u002d\\u002dwp\\u002d\\u002dcustom\\u002d\\u002dgap\\u002d\\u