(1,1,'2025-04-24 12:27:10','2025-04-24 16:27:10','<label> Tu nombre\n    [text* your-name autocomplete:name] </label>\n\n<label> Tu correo electrónico\n    [email* your-email autocomplete:email] </label>\n\n<label> Asunto\n    [text* your-subject] </label>\n\n<label> Tu mensaje (opcional)\n    [textarea your-message] </label>\n\n[submit \"Enviar\"]\n[_site_title] «[your-subject]»\n[_site_title] <wordpress@54.225.132.247>\nDe: [your-name] [your-email]\nAsunto: [your-subject]\n\nCuerpo del mensaje:\n[your-message]\n\n-- \nEsto es un aviso de que se ha enviado un formulario de contacto en tu web ([_site_title] [_site_url]).\n[_site_admin_email]\nReply-To: [your-email]\n\n0\n0\n\n[_site_title] «[your-subject]»\n[_site_title] <wordpress@54.225.132.247>\nCuerpo del mensaje:\n[your-message]\n\n-- \nEste correo electrónico es un acuse de recibo del envío de tu formulario de contacto en tu web ([_site_title] [_site_url]) en la que se usó tu dirección de correo electrónico. Si no eres tú, por favor, ignora este mensaje.\n[your-email]\nReply-To: [_site_admin_email]\n\n0\n0\nGracias por tu mensaje. Ha sido enviado.\nHa ocurrido un error al intentar enviar tu mensaje. Por favor, inténtalo de nuevo más tarde.\nUno o más campos tienen un error. Por favor, revísalos e inténtalo de nuevo.\nHa ocurrido un error al intentar enviar tu mensaje. Por favor, inténtalo de nuevo más tarde.\nDebes aceptar los términos y condiciones antes de enviar tu mensaje.\nPor favor, rellena este campo.\nEste campo tiene una entrada demasiado larga.\nEste campo tiene una entrada demasiado corta.\nHa ocurrido un error desconocido al subir el archivo.\nNo tienes permisos para subir archivos de este tipo.\nEl archivo subido es demasiado grande.\nHa ocurrido un error al subir el archivo.','Formulario de contacto 1','','publish','closed','closed','','formulario-de-contacto-1','','','2025-04-24 12:27:10','2025-04-24 16:27:10','',0,'http://54.225.132.247/?post_type=wpcf7_contact_form&p=1',0,'wpcf7_contact_form',