(49,'woocommerce-WooPayments-Aug-2023-security-updated','update','en_US','Security update of WooPayments (WooCommerce Payments) plugin','<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(50,'avalara_q3-2023_noAvaTax','marketing','en_US','Automatically calculate VAT in real time','Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(51,'woocommerce-usermeta-Sept2023-productvendors','update','en_US','Your store requires a security update','<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(52,'woocommerce-STRIPE-Oct-2023-update-needed','update','en_US','Action required: Security update for WooCommerce Stripe Gateway','<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(53,'amazon-mcf-reviews-2023-12-07','marketing','en_US','Enjoying Amazon MCF for WooCommerce?','We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and we’d love to make things right!','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(54,'remove_estimated_deposits_2024','marketing','en_US','Estimated deposits are going away','To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(55,'sirt-woo-2024-11-xss-admin','update','en_US','An important update is required for WooCommerce','This update addresses a security vulnerability that could allow unauthorized access to administrative privileges on your site. <a href=\"https://developer.woocommerce.com/2024/12/03/woocommerce-9-4-3-and-woocommerce-9-3-4-available-now/\">Learn more</a>.\r\n<br><br>\r\n<strong>Please ensure your site is updated to the latest version to stay secure.</strong>','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(56,'woocommerce-analytics-order-attribution-promotions-december-2024','marketing','en_US','Discover what drives your sales','Use our powerful <strong>Order Attribution</strong> extension to understand what truly drives your revenue. Track your sales journey, identify your most effective marketing channels, and optimize your sales strategy.','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(57,'paypal-braintree-sdk-depreciation-2025-02-20','update','en_US','Update required for your PayPal Braintree extension','To continue securely accepting payments, you must update your PayPal Braintree extension to version 3.2.4 or newer before June 30, 2025. Your current extension version will not support payment processing after this date due to an SSL certificate update.','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(58,'WooCommerce-Stripe-Gateway-Update-April-2025','update','en_US','Action required: Update WooCommerce Stripe Gateway to v9.4.1','<strong>An important update for WooCommerce Stripe Payment Gateway has been released</strong>. Version 9.4.1 addresses performance issues and payment method visibility problems that occurred in version 9.4.0. Please update as soon as possible for optimal store performance. Please read <a href=\"https://developer.woocommerce.com/2025/04/18/https://developer.woocommerce.com/2025/04/18/developer-advisory-stripe-payment-gateway-9-4-1-release/\" /> this advisory</a> for more information.','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(59,'WooCommerce-Stripe-Gateway-Update-Info-April-2025','update','en_US','WooCommerce Stripe Gateway has been updated to v9.4.1','<strong>WooCommerce Stripe Payment Gateway was recently updated</strong>. Version 9.4.1 addresses performance issues and payment method visibility problems that occurred in version 9.4.0. No further action is required. Please read <a href=\"https://developer.woocommerce.com/2025/04/18/https://developer.woocommerce.com/2025/04/18/developer-advisory-stripe-payment-gateway-9-4-1-release/\" /> this advisory post </a>for more information.','{}','pending','woocommerce.com','2025-04-24 16:05:05',NULL,0,'plain','',0,0,'info'),
(60,'wc-admin-customizing-product-catalog','info','en_US','Cómo personalizar tu catálogo de productos','Quieres que tu catálogo de productos y tus imágenes tengan un aspecto estupendo y estén en consonancia con tu marca. Esta guía te dará todos los consejos que necesitas para que tus productos se vean bien en tu tienda.','{}','unactioned','woocommerce-admin','2025-04-25 16:08:01',NULL,0,'plain','',0,1,'info'),
(61,'wc-admin-mobile-app','info','en_US','Instala la aplicación móvil WooCommerce','Instala la aplicación móvil de WooCommerce para gestionar pedidos, recibir avisos de ventas y ver métricas clave – allí donde estés.','{}','unactioned','woocommerce-admin','2025-04-26 16:48:27',NULL,0,'plain','',0,1,'info'),
(62,'wc-admin-marketing-jetpack-backup','marketing','en_US','Protege tu tienda de WooCommerce con Jetpack Backup.','Tener una tienda inactiva implica una pérdida de ventas. Las restauraciones en un solo clic te ayudan a volver a estar operativo rápidamente si hay algún problema.','{}','unactioned','woocommerce-admin-notes','2025-04-27 16:11:09',NULL,0,'thumbnail','http://54.225.132.247/wp-content/plugins/woocommerce/assets/images/admin_notes/marketing-jetpack-2x.png',0,1,'info'),
(63,'wc-admin-onboarding-payments-reminder','info','en_US','¡Empieza a aceptar pagos en tu tienda!','Acepta pagos mediante el proveedor adecuado para ti - elige entre más de 100 pasarelas de pago para WooCommerce.','{}','unactioned','woocommerce-admin','2025-04-29 16:10:32',NULL,0,'plain','',0,1,'info'),
(64,'klaviyo_q2_2025','marketing','en_US','Tailor your marketing with data-driven automation','Deliver personalized experiences at scale, simplify your stack, and make your data work for you using Klaviyo’s best-in-class marketing extension for Woo. With advanced segmentation based on actual customer behavior, you can send email and SMS messages that drive revenue and increase loyalty — without adding complexity','{}','pending','woocommerce.com','2025-04-30 16:17:04',NULL,0,'plain','',0,0,'info'),
(65,'uk-vat-notice-2025-04-30','warning','en_US','UK VAT numbers are no longer supported','Due to recent HM Revenue &amp; Customs (HMRC) VAT API changes, your EU VAT Number for WooCommerce extension can no longer validate UK VAT numbers. HMRC now requires merchants to register an API key, which this extension does not currently support. We recommend EU/UK VAT Validation Manager for WooCommerce as a replacement','{}','pending','woocommerce.com','2025-05-05 16:48:08',NULL,0,'plain','',0,0,'info'),
(66,'payson-retirement-2025','update','en_US','Payson Form Retirement','Svea Bank is discontinuing the Payson service; the last date for transactions is August 31, 2025. As a result, the Payson Form extension has been removed from WooCommerce.com. Documentation remains available.','{}','pending','woocommerce.com','2025-05-13 16:06:08',NULL,0,'plain','',0,0,'info'),
(67,'paypal_q2_2025','marketing','en_US','Power up sales with Pay Later messaging','Help increase your sales and grow cart sizes by letting customers know they have flexible payment options. Merchants see up to an 11% sales lift when they add Pay Later messaging — plus, it integrates seamlessly with your PayPal checkout.','{}','pending','woocommerce.com','2025-05-22 16:26:47',NULL,0,'plain','',0,0,'info'),
(68,'paypal-braintree-sdk-depreciation-2025-05-30','update','en_US','Action required: Update the PayPal Braintree extension','Your PayPal Braintree extension is using an outdated SDK and will stop processing payments after June 30, 2025, due to a root SSL certificate expiration. To avoid service disruption, update to version 3.2.4 or newer immediately.','{}','pending','woocommerce.com','2025-05-29 16:06:09',NULL,0,'plain','',0,0,'info'),
(69,'tento_q2_2025','marketing','en_US','Get your free business credit score','Strong business credit is the key to better deals, stronger partnerships, and sustainable growth. Tento Business Credit Monitoring helps you catch risks early, secure better financing, and fuel smarter growth — with no impact to your credit.','{}','pending','woocommerce.com','2025-06-04 16:25:18',NULL,0,'plain','',0,0,'info'),
(70,'woopayments-multibanco-alipay-wechat-launch-2025-06-23','marketing','en_US','Multibanco, AliPay and WeChat now available in WooPayments','Multibanco, AliPay, and WeChat Pay are now available in WooPayments! Offer trusted local payment methods to customers in key global markets and boost international sales. Geo restrictions apply.','{}','pending','woocommerce.com','2025-06-23 16:09:07',NULL,0,'plain','',0,0,'info'),
(71,'woopayments-new-lpms-2025-06-30','marketing','en_US','Boost global sales with more local payments','Support for AliPay, GrabPay, Multibanco, and WeChat Pay is now built into WooPayments in applicable regions. Enable them today to give customers around the globe the convenience of local payment methods — and boost your international sales with a few simple clicks.','{}','pending','woocommerce.com','2025-06-30 16:05:15',NULL,0,'plain','',0,0,'info'),
(72,'tiktok-webinar-promo-july2025','marketing','en_US','You\'re Invited: TikTok for WooCommerce Webinar','Join us for a free webinar with our friends at TikTok on Tuesday, July 8, at 4 pm UTC. We\'ll cover creative tips and best practices for making content that turns views into sales.','{}','pending','woocommerce.com','2025-06-30 16:05:15',NULL,0,'plain','',0,0,'info'),
(73,'woopayments-grabpay-launch-2025-07-07','marketing','en_US','GrabPay now available in WooPayments','Offer GrabPay through WooPayments and make checkout easier for customers across Southeast Asia. Enable it today and expand your reach with a payment method they know and trust.','{}','pending','woocommerce.com','2025-07-07 16:12:14',NULL,0,'plain','',0,0,'info'),
(74,'BFCM-25-Survey','marketing','en_US','You’re invited: Take our quick BFCM survey and get 25% off','We’re gathering insights on how businesses prepare for peak sales moments like Black Friday and Cyber Monday — so we can better support you. Take our quick 8-minute survey to share your thoughts and get 25% off your next WooCommerce extension as a thank you.','{}','pending','woocommerce.com','2025-07-14 16:12:26',NULL,0,'plain','',0,0,'info'),
(75,'woohoo10-coupon','marketing','en_US','Celebrate and save with WooCommerce 10.0','To mark this milestone release, get 10% off extensions and themes in the official Woo Marketplace. Use code WOOHOO10 at checkout to save on essential tools that help grow your business. Offer ends August 15, 2025. Terms and conditions apply.','{}','unactioned','woocommerce.com','2025-07-21 16:31:19',NULL,0,'plain','',0,0,'info'),
(76,'wc-admin-real-time-order-alerts','info','en_US','Recibe alertas de pedidos en tiempo real en cualquier lugar','Recibe avisos sobre la actividad de la tienda, incluidos nuevos pedidos y valoraciones de productos directamente en tus dispositivos móviles con la aplicación Woo.','{}','unactioned','woocommerce-admin','2025-07-23 16:26:28',NULL,0,'plain','',0,0,'info'),
(77,'paypaladvantage_q3_2025','marketing','en_US','Add PayPal Checkout and earn up to $1,000*','PayPal Checkout can boost conversion by up to 46% and average order value by up to 62% with no disruption to your checkout. New US merchants who activate by August 31 save 25% on transaction fees for 6 months. Excludes Venmo. Terms apply.*','{}','pending','woocommerce.com','2025-07-23 16:26:29',NULL,0,'plain','',0,0,'info');
